import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #1976D2;
  color: white;
  text-align: center;
  padding: 20px 0;
  margin-top: 100px; // 100px margin at the top as requested
  width: 100%;
`;

const FooterText = styled.p`
  margin: 0;
  font-size: 16px;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterText>Made with love at HackMIT by [Your Team Name]</FooterText>
    </FooterContainer>
  );
};

export default Footer;
